import React from 'react';
import "./Form.css";

const AlexanderNeumann = () => {
    return (
        <span> Alexander Neumann is the 27 year old graphic designer and developer of this front-end Challenge.
            In his graphic design work, he has worked for <a href="https://en.wikipedia.org/wiki/Christopher_Wylie"
                target="_blank">Christopher Wylie</a> as well as developed his own block stacking game, <a
                    href="https://vimeo.com/648414048" target="_blank">Misfits</a>. In a front-end capacity,
            he worked for <a href="https://edaid.com/"
                target="_blank">EdAid</a>, created a <a href="https://https://gooddaydashboard.herokuapp.com/" rel="noopener">>jQuery dashboard</a> for
            up-to-the-minute conditions in London, UK, and recently completed a 6 month Software Engineering Immersive with General Assembly.
        </span >
    )
}
export default AlexanderNeumann;
